    function trace(data) {
        traceDom = document.getElementById("map-container");
        traceChart = echarts.init(traceDom);
        app = {};
        ips = data;
        ipCount = 0;
        ipLength = ips.length;
        GYData = [];
        cityValue = {};
        option = null;
        getCityByIp();
    }

    /**
     * 全局追溯的资源
     */
    function convertData(data) {
        var res = [];
        for (var i = 0; i < data.length; i++) {
            var dataItem = data[i];
            if (dataItem[1].name == '钓鱼岛') {
                continue;
            }
            var fromCoord = geoCoordMap[dataItem[1].name];
            var toCoord = geoCoordMap[dataItem[0].name];
            if (fromCoord && toCoord) {
                res.push({
                    fromName: dataItem[0].name,
                    toName: dataItem[1].name,
                    coords: [fromCoord, toCoord]
                });
            }
        }
        return res;
    }

    /**
     * 全局内容初始化
     */
    function traceInit() {
        var color = ['#a6c84c', '#ffa022', '#46bee9'];
        var series = [];
        [['成都', GYData]].forEach(function (item, i) {
            series.push({
                name: item[0] + '数据开放',
                type: 'lines',
                zlevel: 1,
                effect: {
                    show: true,
                    period: 6,
                    trailLength: 0.7,
                    color: '#fff',
                    symbolSize: 1
                },
                lineStyle: {
                    normal: {
                        color: color[0],
                        width: 0,
                        curveness: 0.2
                    }
                },
                data: convertData(item[1])
            },
                {
                    name: '数据开放',
                    type: 'lines',
                    zlevel: 2,
                    symbol: ['none', 'arrow'],
                    symbolSize: 10,
                    effect: {
                        show: true,
                        period: 6,
                        trailLength: 0,
                        symbol: 'circle',
                        symbolSize: 3
                    },
                    lineStyle: {
                        normal: {
                            color: color[0],
                            width: 0,
                            opacity: 0,
                            curveness: 0.2
                        }
                    },
                    data: convertData(item[1])
                },
                {
                    name: item[0] + '数据开放',
                    type: 'effectScatter',
                    coordinateSystem: 'geo',
                    zlevel: 2,
                    rippleEffect: {
                        brushType: 'stroke'
                    },
                    label: {
                        normal: {
                            show: true,
                            position: 'center',
                            formatter: ''
                        }
                    },
                    symbolSize: function (val) {
                        var size = val[2] / 8;
                        size = size > 20 ? 20 : size;
                        //                           size = size < 10 ? 10 : size;

                        return size;
                    },
                    itemStyle: {
                        normal: {
                            color: color[1]
                        }
                    },
                    data: item[1].map(function (dataItem) {
                        return {
                            name: dataItem[1].name,
                            value: geoCoordMap[dataItem[1].name].concat([dataItem[1].value])
                        };

                    })
                });
        });

        option = {
            tooltip: {
                show: true,
                formatter: function (params, ticket, callback) {
                    var value = cityValue[params.name];
                    if (params.name == '') {
                        return '';
                    }
                    return params.name + "(" + value + ")";
                }
            },
            geo: {
                map: 'china',
                label: {
                    emphasis: {
                        show: false
                    }
                },
                zoom: 1.2,
                roam: true,
                itemStyle: {
                    normal: {
                        areaColor: 'rgba(0,145,240,0.20)',
                        borderColor: '#404a59'
                    },
                    emphasis: {
                        areaColor: '#2a333d'
                    }
                },
            },
            series: series
        };
        if (option && typeof option === "object") {
            traceChart.setOption(option, true);
            traceChart.dispatchAction({ type: 'showTip', seriesIndex: '1', dataIndex: '1' })
        }
    }
    /**
     * 初始化全局追溯城市数据
     */
    function getCityByIp() {
        var ip = ips[ipCount++];

        var city = ip.city;
        if (typeof (geoCoordMap[city]) == "undefined") {
            getCityByIp();
            return;
        }
        var value = parseInt(ip.cityCount);
        var item = [{ name: '成都' }, { name: city, value: value }];

        GYData.push(item);
        cityValue[city] = value;
        if (ipCount < ipLength) {
            getCityByIp();
        } else {
            traceInit();
        }
    }

